import React, { FunctionComponent } from "react";
import { Link } from "react-router-dom";

type LinkProps = {
    to: string;
    className: string;
    children: string;
};

const LinkComponent: FunctionComponent<LinkProps> = ({
    to,
    className,
    children,
}) => (
    <Link to={to} className={className}>
        {children}
    </Link>
);

export default LinkComponent;
